import React from "react";
import styles from "./Menu.module.css";
import {NavLink} from "react-router-dom";

export default function Menu() {
  return (
    <div className={styles.list}>
        <NavLink to = {"/"}>Home</NavLink>
        <NavLink to ={"/about"}>About</NavLink>
    </div>
  );
}
